func lengthOfLongestSubstring(s string) int {
    maxLen := 0
    minIndex := 0
    maxIndex := 1
    currLen := 0

    for maxIndex <= len(s) {
        if uniqueChars(s[minIndex:maxIndex]) {
            currLen = maxIndex - minIndex
            maxIndex++
        } else {
            if currLen > maxLen {
                maxLen = currLen
            }
            currLen = 0
            minIndex++
        }
    }
    if currLen > maxLen {
        maxLen = currLen
    }

    return maxLen
}

func uniqueChars(s string) bool {
    subs := map[int32]bool{}
    for _, c := range(s) {
        _, seen := subs[c]
        if seen {
            return false
        }
        subs[c] = true
    }
    return true
}
